import React from 'react'
import './Header.scss'
import {NavLink} from "react-router-dom";

export const Header = () => {
    return (
        <div>
            {/* Меню навигационного бара */}
            <nav className="navbarStyle">
                <ul className="ulStyle">
                    <li className="liStyle">
                        <NavLink to="/MainPage" className="linkStyle">Главная</NavLink>
                    </li>
                    <li className="liStyle">
                        <NavLink to="/Delivery" className="linkStyle">Доставка</NavLink>
                    </li>
                    <li className="liStyle">
                        <NavLink to="/Photo" className="linkStyle">Фото</NavLink>
                    </li>
                    <li className="liStyle">
                        <NavLink to="/Constructor" className="linkStyle">Конструтор</NavLink>
                    </li>
                </ul>

                {/* Ссылки на вход и регистрацию */}
                {/*<ul className="RegAndEnt">*/}
                {/*    <li className="liStyle">*/}
                {/*        <NavLink to="/Entrance" className="linkStyle">Войти</NavLink>*/}
                {/*    </li>*/}
                {/*</ul>*/}
                <div>
                    <NavLink to="/Entrance" className="linkStyle">Войти</NavLink>
                </div>
            </nav>
        </div>
    )
}

export default Header;
